// react
import React, { Component } from 'react';

// third-party
import { Link } from 'react-router-dom';

export class LogoPanel extends Component {
    render() {

        const logo = [
            { name: "e-KAT", mode: "buyer" }
        ]

        return (
            <div className="logo-panel">
                {
                    logo.map((item, index) => {
                        return (
                            <Link key={index} to="/" className="logo-link">
                                <span className="logo-name">
                                    {item.name}
                                </span>
                                <span className="logo-name-mode">
                                    {item.mode}
                                </span>
                            </Link>
                        );
                    })
                }
            </div>
        );
    }
}
